import React from 'react';
import Card from './Post Animation'


class Post extends React.Component {
    constructor(){
        super()
        this.state = {
            verified : false
        }
    }

    onClick(){
        console.log(this.props.key)
    }

    render(){
        return(
            <Card title={this.props.title} onClick={this.onClick}></Card>
        )
    }
}


export default Post
